(1, 1, '2018-04-26 10:32:03', '2018-04-26 13:32:03', 'Bem-vindo ao WordPress. Esse é o seu primeiro post. Edite-o ou exclua-o, e então comece a escrever!', 'Olá, mundo!', '', 'publish', 'open', 'open', '', 'ola-mundo', '', '', '2018-04-26 10:32:03', '2018-04-26 13:32:03', '', 0, 'http://localhost/wpboiler/?p=1', 0, 'post', '', 1),
(2, 1, '2018-04-26 10:32:03', '2018-04-26 13:32:03', 'Este é o exemplo de uma página. É diferente de um post de blog porque é estática e pode aparecer em menus de navegação (na maioria dos temas). A maioria das pessoas começam com uma página \'Sobre\' que as apresenta aos potenciais visitantes do site. Você pode usar algo como:\r\n<blockquote>Oi! Sou um estudante de Biologia e gosto de esportes e natureza. Nos fins de semana pratico futebol com meus amigos no clube local. Eu moro em Valinhos e fiz este site para falar sobre minha cidade.</blockquote>\r\n...ou algo como:\r\n<blockquote>A empresa Logos foi fundada em 1980, e tem provido o comércio local com o que há de melhor em informatização. Localizada em Recife, nossa empresa tem se destacado como um das que também contribuem para o descarte correto de equipamentos eletrônicos substituídos.</blockquote>\r\nComo um novo usuário WordPress, vá ao seu <a href="http://localhost/wpboiler/wp-admin/">Painel</a> para excluir este conteúdo e criar o seu. Divirta-se!', 'Home', '', 'publish', 'closed', 'closed', '', 'home', '', '', '2018-04-27 10:53:44', '2018-04-27 13:53:44', '', 0, 'http://localhost/wpboiler/?page_id=2', 0, 'page', '', 0),
